goog.provide("goog.defineClassTest");goog.setTestOnly("goog.defineClassTest");goog.require("goog.testing.jsunit");function testSuper(){function SomeSuper(){};var SomeClass=goog.defineClass(SomeSuper,{constructor:function(){}});assertTrue(new SomeClass instanceof SomeClass);assertTrue(new SomeClass instanceof SomeSuper)}function testPrototypeProp(){var SomeClass=goog.defineClass(null,{constructor:function(){},trueMethod:function(){return!0}});assertEquals(new SomeClass().falseProp,!1);assertEquals(new SomeClass().trueMethod(),!0)}function testInstanceProp(){var SomeClass=goog.defineClass(null,{constructor:function(){this.falseProp=!1}});assertEquals(new SomeClass().falseProp,!1)}function testPrototypeProp(){var SomeClass=goog.defineClass(null,{constructor:function(){},trueMethod:function(){return!0}});assertEquals(new SomeClass().trueMethod(),!0);assertEquals(SomeClass.prototype.trueMethod(),!0)}function testStaticProp(){var SomeClass=goog.defineClass(null,{constructor:function(){},statics:{someProp:100}});assertEquals(new SomeClass().statics,void 0);assertEquals(new SomeClass().someProp,void 0);assertEquals(SomeClass.someProp,100)}function testStaticPropFn(){var SomeClass=goog.defineClass(null,{constructor:function(){},statics:function(cls){cls.someProp=100}});assertEquals(new SomeClass().statics,void 0);assertEquals(new SomeClass().someProp,void 0);assertEquals(SomeClass.someProp,100)}function testUid(){var SomeClass=goog.defineClass(null,{constructor:function(){}}),obj1=new SomeClass,obj2=new SomeClass;assertEquals(goog.getUid(obj1),goog.getUid(obj1));assertEquals(goog.getUid(obj2),goog.getUid(obj2));assertNotEquals(goog.getUid(obj1),goog.getUid(obj2))}